import React from "react";
import axios from "axios";
import { saveAs } from "file-saver";
import "./App.css";

function App() {
  handleChange = () => {};
  return (
    <div className="App">
      <input
        type="text"
        placeholder="Name"
        name="name"
        onChange={this.handleChange}
      ></input>
      <input
        type="number"
        placeholder="Receipt ID"
        name="receiptId"
        onChange={this.handleChange}
      ></input>
      <input
        type="number"
        placeholder="Price1"
        name="price1"
        onChange={this.handleChange}
      ></input>
      <input
        type="number"
        placeholder="Price2"
        name="price2"
        onChange={this.handleChange}
      ></input>
      <button onClick={this.createAndDownloadPDF}>Download PDF</button>
    </div>
  );
}

export default App;
